parameters:
Trying to escape from the strange pig was futile;
its body was much larger than mine and impossible
to push away.

The sight of Saku's sad face pains my heart.
Instead of helping her, I can't even stand up;
surely Saku is disappointed in me as a goddess.

(No, get out! It entered my mouth! It feels
disgusting; it's slimy; it tastes bitter and sour;
it smells strange; it's muddy)

My insides are being pounded violently. The pain
is so intense that I can't think of anything else;
even the will to argue back is shattered.
